import Home from './componants/Home'
import List from './componants/List'
import Navbar from './componants/Navbar'

// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Home />
      <Navbar />
      <Form />
      <List />
    </div>

  );
}

export default App;
